import style from './Card.module.css';

const Card = ({name, image, type}) => {
    const types = type.map(type => `<li>${type}</li>`);

    return(
        <div className={style.card}>
            <h1>{name.toUpperCase()}</h1>
            <img className={style.image} src={image} alt="" />
            <h4>Tipos:</h4>
            <ul>{types}</ul>
        </div>
    )
};

export default Card;
